import { Link } from 'react-router-dom';
import './SignupFormStyles.css';

function SignupForm() {
    return (
        <div className='signup-form'>
            <h1>Sign Up</h1>
            <form>
                
                <Link to='/submit' className='form-btn'>Sign Up</Link>
                <p></p>
            </form>
            <Link to='/register'>Register</Link>
        </div>
    )
}
export default SignupForm;
